import axios from "axios";
const API_URL = "http://localhost:5000/";

export const registerUser = async (name, email, password) => {
  const body = {
    name: "Yogesh",
    email: "asdf@asdf.com",
    password: "password",
  };
  const res = await axios.post("http://localhost:5000/api/user/register", body);
  console.log(await res);
};
